import React from "react";
import RegisterPage from "./registerpage";
import {NavLink} from 'react-router-dom';
// import Link from 'bootstrap';

const LoginPage = () => {
    return (
        
        <div className="container col-md-5 mt-5 p-5 bg-info card shadow rounded">
            <div className="text-center mb-2">
                <h5>Login Here</h5>
            </div>
            <form >
                <div class="form-group">
                    <label for="exampleInputEmail1">Email address / UserId</label>
                    <input type="email" class="form-control" aria-describedby="emailHelp" placeholder="Enter email / UserId" />
                </div>
                <div class="form-group mt-2">
                    <label for="exampleInputPassword1">Password</label>
                    <input 
                    type="password" 
                    class="form-control" placeholder="Password" />
                </div>
                <div class="btn-toolbar justify-content-between mt-4" role="toolbar" aria-label="Toolbar with button groups">
                    <button type="button" class="btn btn-success">Login</button>
                    <div class="text-group-prepend">
                        <label>New User? <NavLink className="btn btn-primary" exact to="./registerpage" >Register</NavLink>
                        </label>
                    </div>
                </div>
            </form>
        </div>
        
    )
}
export default LoginPage;
